	add("gradualism", "{\"term\":\"gradualism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|gradual|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The belief that evolution proceeds at a steady pace, without the sudden development of new species or biological features from one generation to the next\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The belief that some phenomenon occurs gradually over a long period of time\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"date\u003d27 November passage\u003dGiven enough time, the logic goes, water can cleave solid rock and mountains can be reduced to plains. This \u0026quot;\u0027\u0027gradualism\u0027\u0027\u0026quot; now underpins modern geologic thought.\u0026amp;nbsp;... Maybe we\u0027ll find evidence that the rock layers are exposed on the flanks of w:Aeolis Mount Sharp [on Mars] not because a river carved through them over millions of years, but because the wind blew against them for billions of years\u0026amp;nbsp;– the ultimate in gradualism\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The belief that change ought to be brought about in small, discrete increments rather than in abrupt strokes such as revolutions or uprisings\", \"priority\":4}]}, \"synonyms\":{}}");

