	add("graduand", "{\"term\":\"graduand\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\"], \"text\":\"Attested since 1882. From \u0027graduandus\u0027 gerundive of \u0027graduare\u0027 (to graduate) \u0026lt;ref name\u003d\u0026quot;mw\u0026quot;\u0026gt;{{R:Merriam Webster Online}}\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A student who has completed the requirements for, but has not yet been awarded, a particular degree\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2005,\u0027\u0027 Mike Amos, \u0027Proud Return of the Pigeon Boy,\u0027 Northern Echo (Darlington, UK); Jul 14, 2005.\u0026lt;ref\u0026gt;[http://wordsmith.org/words/graduand.html graduand], A.Word.A.Day\u0026lt;/ref\u0026gt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In order to add jollity to the proceedings, said the dean, each \u0027\u0027graduand\u0027\u0027 would find beneath his seat a little tub of bubbles, complete with mortar board cap\", \"priority\":3}]}, \"synonyms\":{}}");

