	add("grama", "{\"term\":\"grama\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Spanish\", \"Latin\"], \"text\":\"From Spanish {{m|es|grama||grass}}, from Latin {{m|la|grāmina}}, plural of {{m|la|grāmen||grass}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A type of grass\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Tom Drury, \u0026quot;Path Lights\u0026quot;, in \u0027The New Yorker\u0027, 17 October 200\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Every few years, Ingrid goes back to take a look, even though all that’s left is the old bleached shell of a house, surrounded by blue \u0027\u0027grama\u0027\u0027 grass and tall trees with pale bark and waxy leaves\", \"priority\":3}]}, \"synonyms\":{}}");

	add("gramarye", "{\"term\":\"gramarye\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) {{m|fro|gramarie}}, variant of {{m|fro|grammaire}}. See {{m|en|grammar}}. Revived by w:Sir Walter Scott|Sir Walter Scott.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Grammar; learning\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Mystical learning; the occult, magic, sorcery\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1885\u0027\u0027, But the daughter of my uncle (this gazelle) had learned \u0027\u0027gramarye\u0027\u0027 and egromancy and clerkly craft from her childhood; so she bewitched that son of mine to a calf, and my handmaid (his mother) to a heifer, and made them over to the herdsman\u0027s care. — Sir Richard Burton, \u0027The Book of the Thousand Nights and One Night\u0027, vol. 1\", \"priority\":3}]}, \"synonyms\":{}}");

