	add("grammar", "{\"term\":\"grammar\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) \u0027gramarye\u0027 () \u0027gramery\u0027 () from Old french (842-ca. 1400) \u0027gramaire\u0027 (lang\u003dfro) from Latin \u0027grammatica\u0027 () from Ancient greek (to 1453) \u0027γραμματική\u0027 (lang\u003dgrc) from \u0027γράμμα\u0027 (lang\u003dgrc) from \u0027γράφω\u0027 (lang\u003dgrc) from Proto-indo-european {{m|ine-pro|*gerebh-||to scratch}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A system of rules and principles for speaking and writing a language\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The study of the internal structure of words (morphology) and the use of words in the construction of phrases and sentences (syntax\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A book describing the rules of grammar of a language\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A formal system specifying the syntax of a language\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Patrick Blackburn · Johan Bos · Kristina Striegnitz, \u0027[http://www.learnprolognow.org/lpnpage.php?pagetype\u003dhtml\u0026amp;pageid\u003dlpn-htmlse33 Learn Prolog Now!]\u0027, \u0026amp;sect;8\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Because real lexicons are big and complex, from a software engineering perspective it is best to write simple grammars that have a simple, well-defined way, of pulling out the information they need from vast lexicons. That is, grammars should be thought of as separate entities which can access the information contained in lexicons. We can then use specialised mechanisms for efficiently storing the lexicon and retrieving data from it\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A formal system defining a formal languag\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The basic rules or principles of a field of knowledge or a particular skill\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, and , Project Syndicate, \u0027[https://www.project-syndicate.org/commentary/solana10/English The New Grammar of Power\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"We must learn a new \u0027\u0027grammar\u0027\u0027 of power in a world that is made up more of the common good – or the common bad – than of self-interest or national interest\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A textbook\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"a \u0027\u0027grammar\u0027\u0027 of geography\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"A grammar school\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"2012, Graeme Paton, \u0027A green light for more \u0027\u0027grammars\u0027\u0027?\u0027 (in \u0027The Daily Telegraph\u0027, 11 January 2012\", \"priority\":14}]}, \"synonyms\":{}}");

