	add("grammatist", "{\"term\":\"grammatist\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"ancient greek (to 1453)\"], \"text\":\"From the French \u0027grammatiste\u0027 from the \u0027grammatista\u0027 from the Ancient greek (to 1453) \u0027γραμματιστής\u0027 from \u0027γράμμα\u0027 (letter)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A teacher of prose literature and letters in Ancient Greece\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1907\u0027\u0027 (Mar.), L. F. Anderson, \u0026quot;A Study of the Prototypes of the Modern Non-professional School among the Greeksand the Romans\u0026quot;, \u0027The Pedagogical Seminary\u0027, \u0027\u002714\u0027\u0027(1): 1-38\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027grammatist\u0027\u0027, apparently, taught literature in so far as it was read while the citharist taught the poetry which was usually sung\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1909\u0027\u0027, Lewis Flint Anderson, \u0027History of Common School Education\u0027, page 1\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The Athenian child\u0027s school education began with the study of letters under the \u0027\u0027grammatist\", \"priority\":5}]}, \"synonyms\":{}}");

