	add("grandboy", "{\"term\":\"grandboy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|grand|boy|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A grandso\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Wade William, \u0027The War, the Lord, \u0026amp; the Old Oak Tree\u0027, [http://books.google.com/books?id\u003d28d3HPKZ-oEC\u0026amp;pg\u003dPT10\u0026amp;lpg\u003dPT10\u0026amp;dq\u003d%22grandboy%22\u0026amp;source\u003dbl\u0026amp;ots\u003dmugZuyzk4j\u0026amp;sig\u003dNYkbfcWERt-00QgMWJYt-UKFnEo\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003djMYhUPP0CcPlyAGE9YHoCQ\u0026amp;ved\u003d0CDYQ6AEwAQ link\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Yeah, but a nigga is still a nigga and your \u0027\u0027grandboy\u0027\u0027 ain\u0027t got no right associating himself with\u0027em\", \"priority\":3}]}, \"synonyms\":{}}");

