	add("grandstanding", "{\"term\":\"grandstanding\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\"], \"text\":\"From English grandstand {{suffix||-ing|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Dramatic or showy behaviour intended to impress an audience or observers\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"date\u003d21 October passage\u003dYes, there were instances of \u0027\u0027grandstanding\u0027\u0027 and obsessive behaviour, but many were concealed at the time to help protect an aggressively peddled narrative of w:Oscar [Oscar] Pistorius the paragon, the emblem, the trailblazer\", \"priority\":2}]}, \"synonyms\":{}}");

