	add("grapnel", "{\"term\":\"grapnel\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"anglo-norman\"], \"text\":\"From Anglo-norman from Old french (842-ca. 1400) \u0027grapil\u0027 \u0027grapin\u0027 (French \u0027grappin\u0027 .\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A small anchor, having more than two flukes, used for anchoring a small vessel\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A grappling iron\", \"priority\":2}]}, \"synonyms\":{}}");

	add("graptolite", "{\"term\":\"graptolite\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027γραπτός\u0027 (painted, marked with letters) {{suffix||lite|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of a group of extinct aquatic colonial invertebrates, of the class \u0027Graptolithina\u0027, from the Cambrian and Carboniferous period\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, \u0027The Earth\u0027, Folio Society 2011, p. 70\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The samples were black shale, and on the shales were some ancient fossils called \u0027\u0027graptolites\", \"priority\":3}]}, \"synonyms\":{}}");

	add("graser", "{\"term\":\"graser\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{acronym of|gamma ray|Gamma Ray amplification|Amplification by the stimulated|Stimulated emission|Emission of radiation|Radiation|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A device for the coherent amplification or generation of electromagnetic radiation in the gamma ray wavelength by the use of excitation energy in resonant atomic or molecular systems\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The beam of coherent gamma rays produced by such a device\", \"priority\":2}]}, \"synonyms\":{}}");

