	add("grasscycling", "{\"term\":\"grasscycling\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Portmanteau of grass + recycling.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The practice of leaving short grass clippings on a lawn as nutrient\", \"priority\":1}]}, \"synonyms\":{}}");

	add("grasshopper", "{\"term\":\"grasshopper\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{compound|grass|hopper|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A herbivorous insect of the order Orthoptera noted for its ability to jump long distances\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A cocktail made with crème de menthe and optionally with creme de cacao\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"a young student in initial stages of training who has been chosen on account of their obvious talen\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, B.P. Terpstra, \u0027Quadrant\u0027, November 2009, No. 461 (Volume LIII, Number 11), Quadrant Magazine Limited, page 2\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Although we don\u0027t know exactly \u0027why\u0027 Li is chosen to dance, we witness a man assuring officials that the child isn\u0027t from bourgeois stock. Phew. There are no known landowners in the family, so the \u0027\u0027grasshopper\u0027\u0027 passes some cultural purity test, in a state often fixated on class warfare, driven by the cult of personality, and bullied by paranoia\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"In ordinary square or upright pianos of London make, the escapement lever or jack, so made that it can be taken out and replaced with the key\", \"priority\":6}]}, \"synonyms\":{}}");

	add("grasshopperdom", "{\"term\":\"grasshopperdom\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|grasshopper|dom|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or essence of being a grasshopper\", \"priority\":1}]}, \"synonyms\":{}}");

