	add("gratification", "{\"term\":\"gratification\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027gratification\u0027 from Latin \u0027grātificātiō\u0027 from Latin \u0027gratificare\u0027 (to do a favor to, oblige, please, gratify) from \u0027gratus\u0027 () + \u0027facere\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of gratifying, or pleasing, either the mind, the taste, or the appetite; as, the gratification of the palate, of the appetites, of the senses, of the desires, of the heart\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"That which affords pleasure; satisfaction; enjoyment; fruition: delight\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A reward; a recompense; a gratuity\", \"priority\":3}]}, \"synonyms\":{}}");

	add("gratitude", "{\"term\":\"gratitude\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Latin\"], \"text\":\"From French \u0027gratitude\u0027 from \u0027lang\u003dla|gratitudo\u0027 () from Latin \u0027lang\u003dla|gratus\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being grateful\", \"priority\":1}]}, \"synonyms\":{}}");

	add("gratuitousness", "{\"term\":\"gratuitousness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|gratuitous|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or characteristic of being gratuitous\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1894\u0027\u0027, w:Thomas Thomas Hardy, \u0027Life\u0027s Little Ironies\u0027, ch. 1\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"I]t is beyond question that there are a few subtle-souled persons with whom the absolute \u0027\u0027gratuitousness\u0027\u0027 of an act of reparation is an inducement to perform it; while exhortation as to its necessity would breed excuses for leaving it undone\", \"priority\":3}]}, \"synonyms\":{}}");

	add("gratuity", "{\"term\":\"gratuity\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027gratuite\u0027 (French \u0027gratuité\u0027 , from \u0027gratuitas\u0027 () from Latin \u0027gratuitus\u0027 (freely given, free) see \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A reward, service, or payment provided freely, without obligation\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"common usage\u0027) An additional charge placed for services rendered; see also: service fee\", \"priority\":2}]}, \"synonyms\":{}}");

	add("gratulation", "{\"term\":\"gratulation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin {{m|la|grātulātiō}}, from {{m|la|grātulor}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A feeling of happiness and satisfaction; joy, especially at one\u0027s good fortune\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1891\u0027\u0027, Mary Noailles Murfree, \u0027In the \u0026quot;Stranger People\u0027s\u0026quot; Country\u0027, Nebraska 2005, p. 206\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Shattuck, all unaccustomed to the practical phenomena of digging, apprehended only cause of \u0027\u0027gratulation\u0027\u0027 that the investigation was to be the less hindered\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The expression of pleasure at someone\u0027s else\u0027s success or luck; congratulation\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"John Milton (1608-1674) in Paradise Lost, Book VIII, \u0026quot; All Heaven, And happy constellations, on that hour Shed their selectest influence; the Earth Gave sign of gratulation, and each hill;\u0026quot\", \"priority\":5}]}, \"synonyms\":{}}");

	add("gravy", "{\"term\":\"gravy\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\"], \"text\":\"From Middle english (1100-1500) \u0027greavie\u0027 probably from \u0027\u0027 \u0027\u0027 the sediment of melted tallow, from Old french (842-ca. 1400) See \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"thumb|right|poutine|Poutine, a Canadian dish of French fries, curds and thumb|right|w:Biscuits and Biscuits and \u0027\u0027gravy\u0027\u0027, a popular meal in the American South\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A thick sauce made from the fat or juices that come out from meat or vegetables as they are being cooked\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A dark savoury sauce prepared from stock and usually meat juices; brown gravy\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A pale sauce prepared from a roux with meat fat; a type of béchamel sauc\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A type of gravy\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Sauce used for pasta\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Curry sauce\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1879\u0027\u0027, \u0027The Sunday at Home\u0027, Volume 26, page 342\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"With this the hostess poured two or three spoonfuls of the \u0027\u0027gravy\u0027\u0027 of the curry on to the rice opposite to each person\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1906\u0027\u0027, Malayan Branch of the Royal Asiatic Society, \u0026quot;Pa Senik and his Son-in-Law Awang\u0026quot;, \u0027Journal of the Straits Branch of the Royal Asiatic Society\u0027, page 59-60\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Now it seems that Pa Senik was a little deaf. Awang noticed that his father-in-law sometimes poured the \u0027\u0027gravy\u0027\u0027 of his curry on his rice and that sometimes he sucked it up\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"1992\u0027\u0027, Khammān Khonkhai, \u0027The Teachers of Mad Dog Swamp\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"This is strained with a piece of cloth or a strainer and the green liquid forms the \u0027\u0027gravy\u0027\u0027 of the curry\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Geok Boi Lee, \u0027Classic Asian Noodles\u0027, Marshall Cavendish (ISBN 9789812613356), page 15\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"Return flaked fish to curry \u0027\u0027gravy\u0027\u0027 and bring to the boil\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"Unearned gain\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"Extra benefit\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"The first thousand tickets and the concessions cover the venue and the band. The rest is \u0027\u0027gravy\", \"priority\":18}]}, \"synonyms\":{}}");

	add("gravamen", "{\"term\":\"gravamen\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"Latin \u0027gravare\u0027 (to load)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The grievance complained of; the substantial cause of the action; also, in general, the ground or essence of a complaint\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1822\u0027\u0027, [http://books.google.co.uk/books?id\u003dT5A-AAAAYAAJ\u0026amp;pg\u003dPA903 \u0027The Annual Register, or a view of the History, Politics, and Literature, of the year 1820\u0027, part II, Abstracts of State Trials], account of trial following the w:Peterloo Peterloo Massacre, pages 902–903\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Falsehood, which was in ordinary cases the \u0027\u0027\u0027gravamen\u0027\u0027\u0027 of the complaint, was omitted altogether in the information against him\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Eric S. Raymond, [http://www.catb.org/~esr/sf-words/essay.html \u0027SF Words and Prototype Worlds\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027gravamen\u0027\u0027 of this essay is that these signifiers (the jargon of SF) function not merely as a set of isolated signs…\", \"priority\":5}]}, \"synonyms\":{}}");

