	add("gravel", "{\"term\":\"gravel\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\"], \"text\":\"From Middle english (1100-1500) from Old french (842-ca. 1400) \u0027gravele\u0027 () diminutive of \u0027grave\u0027 (lang\u003dfro)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Small fragments of rock, used for laying on the beds of roads and railroads, and as ballast\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A type or grade of small rocks, differentiated by mineral type, size range, or other characteristics\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A particle from 2 to 64 mm in diameter, following the Wentworth scal\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"kidney Kidney stones; a deposit of small calculous concretions in the kidneys and the urinary or gall bladder; also, the disease of which they are a symptom\", \"priority\":4}]}, \"synonyms\":{}}");

