	add("graveyard", "{\"term\":\"graveyard\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{compound|grave|yard|lang\u003den}}. Compare Dutch {{m|nl|begraafplaats||graveyard}}, Norwegian {{m|no|gravplass||graveyard}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A tract of land in which the dead are buried\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A final storage place for collections of things that are no longer useful or useable\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The discard pile, in some trading card games. \u0026lt;!--e.g. Magic the Gathering; Yu-Gi-Oh!--\u0026gt;Category:en:Magic: The Gatherin\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A team where players are sent when they are not useful, or a team where players become useless if sent there\", \"priority\":4}]}, \"synonyms\":{}}");

