	add("grawlix", "{\"term\":\"grawlix\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Apparently coined by American cartoonist w:Mort Walker|Mort Walker circa 1964.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"thumb|right|148p\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A spiral-shaped graphic used to indicate swearing in comic strips\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027, William H. Gass, \u0027The Tunnel\u0027, page 15\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"He does all the Popeye voices, but prefers Olive Oyl\u0027s. He has noises for the nittles, the \u0027\u0027grawlix\u0027\u0027, the quimps, the jarns. He blows each balloon up before your ears. He reels home, +\u0027s on his eyes, singing the spirl that rises like heat from his head\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A string of typographical symbols, especially \u0026quot\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"amp;!\u0026quot;, used (especially in comic strips) to represent an obscenity or swearword\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A series of violence related images in a speech bubble to represent obscenity, swearwords, or profanity\", \"priority\":7}]}, \"synonyms\":{}}");

	add("grayling", "{\"term\":\"grayling\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|gray|ling|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any freshwater fish of the genus \u0027Thymallus\u0027 or specifically \u0027Thymallus thymallus\u0027, of the salmon family, having a large dorsal fin\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d“Piracy”: A Romantic Chronicle of These chapter\u003d3/19/2|url\u003dhttp://openlibrary.org/works/OL1519647W|passage\u003d“This morning,” he said, “We will fish, Turner. We will cast for trout so that we may catch \u0027\u0027grayling\u0027\u0027.”\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A species of butterfly, of the family Nymphalidae\", \"priority\":3}]}, \"synonyms\":{}}");

